ends. \r\nEnclosed is a media kit detailing our services, along with \'before\' and \'after\' results from our Social Media Management within one month. \r\nWould you be open to a quick Zoom call in the next few days? I’d love to discuss how we can help grow your brand. \r\nBest regards, \r\nTina Toth \r\nFounder, Alegria Social \r\nInstagram: @laelegantia', '2025-02-12 07:04:59', '2025-02-12 07:04:59'),
