(1, 'Health newsletter', 'Health is wealth. to this regard, endeavour to take goo care of your health at all cost. this way, you will be able to go about your daily task without worry of break down.', '2024-11-15 12:15:56', '2024-11-15 12:15:56'),
(2, 'About Endoscopy', 'An endoscopy is a procedure used in medicine to look inside the body. The endoscopy procedure uses an endoscope to examine the interior of a hollow organ or cavity of the body. Unlike many other medical imaging techniques, endoscopes are inserted directly into the organ.\r\n\r\nThere are many types of endoscopies. Depending on the site in the body and type of procedure, an endoscopy may be performed by either a doctor or a surgeon. A patient may be fully conscious or anaesthetised during the procedure. Most often, the term endoscopy is used to refer to an examination of the upper part of the gastrointestinal tract, known as an esophagogastroduodenoscopy.\r\n\r\nFor nonmedical use, similar instruments are called borescopes.', '2024-11-15 19:23:45', '2024-11-15 19:23:46');

